INSERT INTO `email` (`email_id`, `email_name`, `email_from_name`, `email_from_address`, `email_subject`, `email_html`) VALUES
(5, 'message_notification', 'F3X Vault', 'noreply@rcvault.com', 'You received a message in F3X Vault', '<html>\r\n<body>\r\nYou have received a new message from {$data.from_name} in your F3X Vault Message Center.<br>\r\n<br>\r\nLog in to <a href="http://f3xvault.com/">http://f3xvault.com/</a> to view it.<br>\r\n<br>\r\nHere is the message summary : <br>\r\n<table style="border-collapse:collapse;">\r\n<tr>\r\n <th align="right" style="border:1px solid black;padding:5px;">From</th>\r\n <td style="border:1px solid black;padding:5px;">{$data.from_name}</td>\r\n</tr>\r\n<tr>\r\n <th align="right" style="border:1px solid black;padding:5px;">Subject</th>\r\n <td style="border:1px solid black;padding:5px;">{$data.user_message_subject}</td>\r\n</tr>\r\n<tr>\r\n <th align="right" valign="top" style="border:1px solid black;padding:5px;">Message</th>\r\n <td  valign="top" style="border:1px solid black;padding:5px;"><pre style="white-space: pre-wrap;">{$data.user_message_text}</pre></td>\r\n</tr>\r\n</table>\r\n</body>\r\n</html>'),
(3, 'feedback', 'F3X Vault', 'info@f3xvault.com', 'Feedback Form Submitted', '<html>\r\n<body>\r\nYou have received a new feedback message.<br>\r\n<br>\r\nHere is the message summary : <br>\r\n<table style="border-collapse:collapse;">\r\n<tr>\r\n <th align="right" style="border:1px solid black;padding:5px;">From</th>\r\n <td style="border:1px solid black;padding:5px;">{$data.pilot_first_name} {$data.pilot_last_name}</td>\r\n</tr>\r\n<tr>\r\n <th align="right" style="border:1px solid black;padding:5px;">Subject</th>\r\n <td style="border:1px solid black;padding:5px;">{$data.user_message_subject}</td>\r\n</tr>\r\n<tr>\r\n <th align="right" valign="top" style="border:1px solid black;padding:5px;">Comments</th>\r\n <td valign="top" style="border:1px solid black;padding:5px;"><pre>{$data.feedback_string}</pre></td>\r\n</tr>\r\n</table>\r\n</body>\r\n</html>'),
(4, 'registration', 'F3X Vault Registration', 'noreply@f3xvault.com', 'Activate Your F3X Vault Account', 'Dear {$data.user_first_name},<br>\r\n<br>\r\nIn order to activate your account, follow the activation link in this email.<br>\r\n<br>\r\nOnce your account is activated, you can log in with the account name and password you provided.<br>\r\n<br>\r\nActivation Link : <a href="http://f3xvault.com/?action=register&function=validate_registration&user_id={$data.user_id}&hash={$data.hash}">http://f3xvault.com/</a><br>\r\n<br>\r\n<br>\r\nUser Name : {$data.user_name}<br>\r\n<br>\r\n<br>\r\nHappy Flying from RC Vault!\r\n\r\n\r\n'),
(6, 'password_recovery', 'F3X Vault', 'noreply@f3xvault.com', 'F3X Vault Password Recovery', 'Dear {$data.user_first_name},<br>\r\n<br>\r\nYou have triggered a password recovery for your account.<br>\r\n<br>\r\nFollow the link in this email and it will allow you to change your password. If you did not trigger this email, then ignore it, or if you are seeing too many, report it to the website admin.<br>\r\n<br>\r\nRecovery Link : <a href="http://f3xvault.com/?action=main&function=pass_recovery&user_id={$data.user_id}&hash={$data.hash}">http://f3xvault.com/</a><br>\r\n<br>\r\n<br>\r\nFor User Name : {$data.user_name}<br>\r\n<br>\r\n<br>\r\nHappy Flying from F3X Vault!\r\n\r\n'),
(7, 'beta', 'RC Vault', 'info@rcvault.com', 'RC Vault Beta Program Invitation', '<html>\r\n<body>\r\n<h1 style="\r\n  font-size: 32px;\r\n  color: #090fa3;\r\n">RC Vault</h1>\r\n<h2 style="\r\n  font-size: 22px;\r\n\r\n  color: #090fa3;\r\n">Online RC Databases and Scoring of RC Gliding Competitions</h2>\r\nDear Avid RC Pilot,<br>\r\n<br>\r\nI wish to invite you to take part in the RC Vault Beta program.<br>\r\n<br>\r\nRC Vault is a new web site devoted to the storage of information about our RC Flying hobby. As a now avid flyer, I grew disappointed with the lack of information regarding our sport.<br>\r\n<br>\r\nThere is such a diversity of planes, flying locations, clubs, and competitions in our hobby, but no place where you can go to get good infomation about them.<br>\r\n<br>\r\nEnter RC Vault. A set of open databases that is meant to be populated by all of the people that actually know the answers and are willing to share. If you happen to be on a trip to Australia, wouldn''t it be cool to get information about where you could fly while you were there? Rules and regulations, and maybe even get a glimpse and contact some of the pilots that might meet you and help you out? I don''t know about you, but I would...<br>\r\n<br>\r\nLet me say that in its Beta format, the site is not yet complete. The plane and location databases are in place, but I am still working on some of the final pieces of the competition scoring section (complicated features like reflights, flyoffs, and matrix draws), although some are relatively complete. (like F3F, F3J and TD)<br>\r\n<br>\r\nOf course, I would like your feedback on the whole experience, from creating an account (you can view without creating an account, but editing requires one) to creating timing for events, to entering locations. The plane and location databases are full of "characteristics" that describe the plane or location, and I can easily add more categories or values if it makes sense to do so. Please let me know if maybe there are any that I can add that would improve the database content.<br>\r\n<br>\r\nAnd in the events section, try and play around with adding pilots, scores and anything else like you were actually running an event competition. It would be great to hear if I was missing some kind of scoring idiosyncrasy. The goal is to eventually be able to run a scoring board and full contest with this site in conjunction with an external display board and sound system. But I''m getting ahead of myself...<br>\r\n<br>\r\nHere is the information to log into the site :<br>\r\n<br>\r\n<pre style="font-size: 12px;">\r\nURL   : <a href="http://rcvault.com/">http://rcvault.com/</a>\r\nLogin : beta\r\nPasswd: f3xrules\r\n</pre>\r\n<br>\r\nOnce you get through the initial password protection, you will then see the site how it will be when launched. This means that you will need to go through the simple registration process to create an account and verify it before you can start populating any of the databases.<br>\r\n<br>\r\nFeel free to create any kind of events you would like. I have the recent Gator F3B event, and the first SCSR F3F event in place. Since you did not create those events, you cannot edit them, although you can view them. I would like to try and keep the plane and locations databases accurate and not have to wipe them before launch.<br>\r\n<br>\r\nI hope that you can take some time to help me make the site better and to see its potential as a great resource for our hobby.<br>\r\n<br>\r\nThanks,<br>\r\n<br>\r\nTim Traver.<br>\r\n<br>\r\n<br>\r\nP.S. - Let me assure you that the reason that you got this invitation is because I have conversed with you in the past, and I have your email address. In no way will your email address be sold, or even available for anyone to see on the site. Your email address will only be used to notify you of any personal messages from other pilots, site information, or possibly club mailing lists you might choose to participate in.<br>\r\n<br>\r\n<br>\r\n</body>\r\n</html>'),
(8, 'final beta', 'F3X Vault', 'info@f3xvault.com', 'F3X Vault Final Beta Program Invitation', '<html>\r\n<body>\r\n<h1 style="\r\n  font-size: 32px;\r\n  color: #090fa3;\r\n">F3X Vault</h1>\r\n<h2 style="\r\n  font-size: 22px;\r\n\r\n  color: #090fa3;\r\n">Online F3X Databases and Scoring of RC Gliding Competitions</h2>\r\nDear Avid F3X Pilot,<br>\r\n<br>\r\nI wish to invite you to take part in the Final phase of the F3X Vault Beta program. The site is just about ready to launch to the community, but I would really like any feedback that you may have before I launch.<br>\r\n<br>\r\nF3X Vault is a new web site devoted to the storage of information about our RC Flying hobby. As a now avid flyer, I grew disappointed with the lack of information regarding our sport. There is such a diversity of planes, flying locations, clubs, and competitions in our hobby, but no place where you can go to get good information about them.<br>\r\n<br>\r\nEnter F3X Vault (newly re-branded to be more specific to our community). A set of open databases that is meant to be populated by all of the people that actually know the answers and are willing to share. If you happen to be on a trip to Australia, wouldn''t it be cool to get information about where you could fly while you were there? Rules and regulations, and maybe even get a glimpse and contact some of the pilots that might meet you and help you out? I don''t know about you, but I would...<br>\r\n<br>\r\nThe site is just about ready to be launched. I have completed all of the major scoring programming except for matrix creation. But you should be able to use the site to score events for F3B, F3F, F3J, F3K and TD events.\r\n<br>\r\nOf course, I would like your feedback on the whole experience, from creating an account (you can view without creating an account, but editing requires one) to creating timing for events, to entering locations. The plane and location databases are full of "characteristics" that describe the plane or location, and I can easily add more categories or values if it makes sense to do so. Please let me know if maybe there are any that I can add that would improve the database content.<br>\r\n<br>\r\nAnd in the events section, try and play around with adding pilots, scores and anything else like you were actually running an event competition. It would be great to hear if I was missing some kind of scoring idiosyncrasy. The goal is to eventually be able to run a scoring board and full contest with this site in conjunction with an external display board and sound system. But I''m getting ahead of myself...<br>\r\n<br>\r\nHere is the information to log into the site :<br>\r\n<br>\r\n<pre style="font-size: 12px;">\r\nURL   : <a href="http://f3xvault.com/">http://f3xvault.com/</a>\r\nLogin : beta\r\nPasswd: f3xrules\r\n</pre>\r\n<br>\r\nOnce you get through the initial password protection, you will then see the site how it will be when launched. This means that you will need to go through the simple registration process to create an account and verify it before you can start populating any of the databases.<br>\r\n<br>\r\nFeel free to create any kind of events you would like. I have the recent Gator F3B event, and the current SCSR F3F events in place. I even have the current IHLGF event that was a few weeks back. Since you did not create those events, you cannot edit them, although you can view them. I would like to try and keep the plane and locations databases accurate and not have to wipe them before launch.<br>\r\n<br>\r\nI hope that you can take some time to help me make the site better and to see its potential as a great resource for our hobby.<br>\r\n<br>\r\nThanks,<br>\r\n<br>\r\nTim Traver.<br>\r\n<br>\r\n<br>\r\nP.S. - Let me assure you that the reason that you got this invitation is because I have conversed with you in the past, and I have your email address. In no way will your email address be sold, or even available for anyone to see on the site. Your email address will only be used to notify you of any personal messages from other pilots, site information, or possibly club mailing lists you might choose to participate in.<br>\r\n<br>\r\n<br>\r\n</body>\r\n</html>');
