INSERT INTO `location` (`location_id`, `location_name`, `location_city`, `state_id`, `country_id`, `location_coordinates`, `location_club`, `location_club_url`, `location_description`, `location_directions`) VALUES
(2001, 'Torrey Pines Gliderport', 'San Diego', 5, 226, '32.890747, -117.251496', 'Torrey Pines Gulls, Torrey Pines Scale Soaring Society', 'http://www.torreypinesgulls.org/', 'Torrey Pines Gliderport has been famous for over 80 years as a premier site for all gliding disciplines. Whether it be full scale gliders, hang gliders, paragliders or RC enthusiasts, it has become a staple of anyones wish list to visit or fly.\r\n\r\nIt sits atop a 350 ft cliff right on the Pacific ocean, where the westerly breezes provide a large steady lift band.\r\n\r\nBecause of all of the manned flight, if one wants to fly their RC gliders, they must be accompanied by a member of the local RC club to be explained the specific rules and regulations of the site. You must have an AMA membership and pay a usage fee to fly, and be extremely careful to keep \\"blue sky\\" in between your model and any paragliders or hang gliders.\r\n\r\nIt is an extremely picturesque and unique landmark to fly and a must see for any RC enthusiast.', 'Easy directions can be found from the google maps links. The RC soaring area is on the right hand side of the take off and landing area that the paragliders and hang gliders use.'),
(2002, 'Poway Glider Field', 'Poway', 5, 226, '32.955109,-117.011696', 'Torrey Pines Gulls', 'http://www.torreypinesgulls.org/', '', ''),
(2003, 'Point Fermin Park', 'San Pedro', 5, 226, '33.707644,-118.294722', '', '', '', ''),
(2004, 'White Point', 'San Pedro', 5, 226, '33.715107,-118.31704', '', '', '', ''),
(2005, 'Grass Mountain', 'Green Valley', 5, 226, '34.640795,-118.41395', '', '', '', ''),
(2006, 'Vincent', 'Acton', 5, 226, '34.505596,-118.103646', '', '', '', ''),
(2007, 'Portuguese Bend', 'Palos Verdes', 5, 226, '33.738377,-118.374391', '', '', '', ''),
(2008, 'Col de Manee', '', 65, 73, '', '', '', '', ''),
(2009, 'Muncie AMA Field', 'Muncie', 14, 226, '40.158984,-85.323926', 'AMA', 'http://www.modelaircraft.org/', '', ''),
(2010, 'Cal Valley', 'Cal Valley', 5, 226, '35.326852, -119.997129', '', '', '', ''),
(2011, 'Dave''s Beach', 'Carlsbad', 5, 226, '33.121178, -117.327474', '', '', 'Dave\\''s beach is a small beach slope that has great lift, easy access and is great for most smaller RC flying aircraft.', 'Get off on California State Highway 5 on Palomar Airport Road and go West towards the beach. Cross the bridge over the railroad tracks and stay right to go around the first right hand offramp.\r\n\r\nAs soon as it joins Pacific Coast Highway, there is limited parking on the right. It is right across from the Hilton Garden Inn.'),
(2012, 'Portuguese Bend - Lower', 'Palos Verdes', 5, 226, '33.740395,-118.375944', '', '', '', ''),
(2017, 'San Simeon', 'San Simeon', 5, 226, '', '', '', '', ''),
(2018, 'Encinitas Landfill', 'Encinitas', 5, 226, '33.039734, -117.249035', 'Torrey Pines Gulls', '', '', ''),
(2014, 'Perris Free Flight/Glider Field', 'Perris', 5, 226, '33.781517,-117.197554', 'The Inland Soaring Society, Southern California Antique Model Pl', 'http://scamps.homestead.com/', '', ''),
(2015, 'IRKS Field', 'Cocoa', 9, 226, '28.388786,-80.832462', 'IRKS', '', '', ''),
(2016, 'HCRC Flying Field', 'Pagosa Springs', 6, 226, '37.24603,-107.09587', 'High Country R/C', 'http://highcountryrc.com', '300'' main runway, 30'' wide. 100'' alternate runway, 20'' wide. Both runways are geotex fabric. Ten primary parking spots with tables.\r\nNo electricity, toilets, food, or running water available.\r\n\r\nField is at 7500'' ASL.', 'See map and directions on website.\r\nhttp://www.highcountryrc.com/HCRC_Map.html'),
(2019, ' SAGE Field', 'Tuscon', 3, 226, '32.387099, -111.248199', 'Southern Arizona Gliders and Electrics', 'http://www.sageflyers.com/', '', '');
