INSERT INTO `user_message` (`user_message_id`, `user_id`, `from_user_id`, `user_message_date`, `user_message_subject`, `user_message_text`, `user_message_read_status`, `user_message_status`) VALUES
(1, 2, 7, '2013-04-03 16:43:23', 'Progress', 'Hey Tim, I got the club added and the flying field added.  Colorado now shows up in the existing states list, but not on the main map.\r\n\r\nSo, this is a test of the messaging function... ok?', 1, 1),
(2, 7, 2, '2013-04-03 16:55:03', 'RE: Progress', 'Ah yes, you found a bug...\r\n\r\nIt appears that the GPS coordinates need to be comma separated when using the Google maps API, so they appeared in the regular map popups, but not on the big map. I just changed it to have a comma, and it appeared...\r\n\r\nand yes, I got your message...;)\r\n\r\nI''m sure you''ll find all sorts of bugs for me...;)\r\n\r\nt\r\n\r\n>Hey Tim, I got the club added and the flying field added.  Colorado now shows up in the existing states list, but not on the main map.\r\n>\r\n>So, this is a test of the messaging function... ok?', 1, 0),
(3, 2, 7, '2013-04-03 17:11:59', 'RE: RE: Progress', 'That''s odd -- my coordinates were copied directly from the Google map that displays when you post the location of a Youtube video, and the location symbol appeared in exactly the right spot when I pasted it in. I guess you need to note that a comma is necessary there.\r\n\r\n>Ah yes, you found a bug...\r\n>\r\n>It appears that the GPS coordinates need to be comma separated when using the Google maps API, so they appeared in the regular map popups, but not on the big map. I just changed it to have a comma, and it appeared...\r\n>\r\n>and yes, I got your message...;)\r\n>\r\n>I''m sure you''ll find all sorts of bugs for me...;)\r\n>\r\n>t\r\n>\r\n>>Hey Tim, I got the club added and the flying field added.  Colorado now shows up in the existing states list, but not on the main map.\r\n>>\r\n>>So, this is a test of the messaging function... ok?', 1, 1),
(4, 2, 7, '2013-04-03 17:18:30', 'Feeback Form Submission', 'Create a blog that''s updated at least weekly so folks will come back to see what''s happening. ', 1, 1),
(5, 7, 2, '2013-04-03 17:20:59', 'RE: RE: RE: Progress', 'yeah, I''ll put it on the list to either do on input, or say to do so...\r\n\r\nI also need to fix the formatting of these longer messages...;)\r\n\r\nt\r\n\r\n\r\n>That''s odd -- my coordinates were copied directly from the Google map that displays when you post the location of a Youtube video, and the location symbol appeared in exactly the right spot when I pasted it in. I guess you need to note that a comma is necessary there.\r\n>\r\n>>Ah yes, you found a bug...\r\n>>\r\n>>It appears that the GPS coordinates need to be comma separated when using the Google maps API, so they appeared in the regular map popups, but not on the big map. I just changed it to have a comma, and it appeared...\r\n>>\r\n>>and yes, I got your message...;)\r\n>>\r\n>>I''m sure you''ll find all sorts of bugs for me...;)\r\n>>\r\n>>t\r\n>>\r\n>>>Hey Tim, I got the club added and the flying field added.  Colorado now shows up in the existing states list, but not on the main map.\r\n>>>\r\n>>>So, this is a test of the messaging function... ok?', 1, 0),
(6, 2, 2, '2013-04-03 21:55:08', 'Feeback Form Submission', 'this is neeto', 1, 0),
(8, 7, 2, '2013-04-04 13:18:49', 'RE: Feeback Form Submission', 'Hey pop!\r\n\r\nDo you mean a blog about this site? or a blog for club admins to use for their clubs?\r\n\r\nI actually started off with the site being wrapped by worpdress, but I had to do too many hacks to run my own stuff in the middle of it. Plus, wordpress is just full of security holes, and I had a bunch of add-on modules, etc...\r\n\r\nJust didn''t want to deal with it any longer, so I built my own registration, login, user tracking etc.. system.\r\n\r\nBut yeah, I think that a blog about this site that shows any new developments would be good...\r\n\r\nt\r\n\r\n\r\n>Create a blog that''s updated at least weekly so folks will come back to see what''s happening. ', 1, 0),
(7, 2, 2, '2013-04-03 21:56:12', 'RE: Feeback Form Submission', 'oh holy moley. I was supposed to actually test that if this text was wider that it would actually wrap in the email message that is sent out...hope it does...\r\n\r\n>this is neeto', 1, 0),
(10, 7, 2, '2013-04-04 14:51:03', 'RE: RE: RE: Feeback Form Submission', 'Hey Pop,\r\n\r\nyeah, this beta only went out to maybe 15 people or so, and I just sent it out yesterday. Mostly to the people that I know in the F3F and B crowd, although I did send it to Oleg and a few other people. I want to get through some of the obvious bugs and necessary improvements before I launch it on the community at large. You know, make sure most everything actually works...;) That''s what a beta is for, right? or maybe that''s alpha...google''s mail I think is still in "beta"...\r\n\r\nOne of the guys that keeps scores for our F3F stuff is excited to put all his years of competitions up. So he''s added some groups, some pilots and some planes I think. But you know how it is...people are busy...\r\n\r\nyeah, its a good idea to have a blog about it. I''ll probably put a link on the menu bar that says blog, and maybe I will include a check box when registering if you want to get sent blog entries. That might keep people coming back.\r\n\r\nAlthough its a relatively static database for things like planes and locations, I can''t tell you how many descriptions of how to get to a particular place to fly are duplicated on rcgroups...so it should get some traffic from just that even...I''m not really trying to run the site for profit or anything, although the idea has come to me to maybe make it a place for small clubs to have their calendars, manage membership dues, etc...in which case maybe I could offset some costs, although it doesn''t really cost me much...;)\r\n\r\nIts a work in progress for sure.\r\n\r\n>Hey Tim,\r\n>\r\n>I''m thinking of a blog like 23andme has.  Their site is primarily data, and once you''ve seen everything, you don''t have much reason to go back.\r\n>\r\n>But they do have an associated blog that has posts about what they''re working on, interesting discoveries, new scientific papers that are published about DNA, etc.\r\n>\r\n>Google does the same thing with the Google Earth blog.\r\n>\r\n>So after you have 1000+ people registered here, every week you''ll have a lot of input from your users about contests, new models, new clubs, etc., and you could probably post frequently from that data alone.\r\n>\r\n>And you could still use Wordpress (or something better for security) by linking to it like I do on highcountryrc.com ...\r\n>\r\n>Pop\r\n>\r\n>P.S. I haven''t seen anything new that doesn''t look like something you added.  How many folks have you included in this beta?  There are a shitload of DLG pilots that are active on RCGroups, some of whom you''ve met (Utah, Arizona), and the Blue Skies series is starting in June (Colorado first).\r\n>\r\n>>Hey pop!\r\n>>\r\n>>Do you mean a blog about this site? or a blog for club admins to use for their clubs?\r\n>>\r\n>>I actually started off with the site being wrapped by worpdress, but I had to do too many hacks to run my own stuff in the middle of it. Plus, wordpress is just full of security holes, and I had a bunch of add-on modules, etc...\r\n>>\r\n>>Just didn''t want to deal with it any longer, so I built my own registration, login, user tracking etc.. system.\r\n>>\r\n>>But yeah, I think that a blog about this site that shows any new developments would be good...\r\n>>\r\n>>t\r\n>>\r\n>>\r\n>>>Create a blog that''s updated at least weekly so folks will come back to see what''s happening. ', 1, 1),
(9, 2, 7, '2013-04-04 14:32:40', 'RE: RE: Feeback Form Submission', 'Hey Tim,\r\n\r\nI''m thinking of a blog like 23andme has.  Their site is primarily data, and once you''ve seen everything, you don''t have much reason to go back.\r\n\r\nBut they do have an associated blog that has posts about what they''re working on, interesting discoveries, new scientific papers that are published about DNA, etc.\r\n\r\nGoogle does the same thing with the Google Earth blog.\r\n\r\nSo after you have 1000+ people registered here, every week you''ll have a lot of input from your users about contests, new models, new clubs, etc., and you could probably post frequently from that data alone.\r\n\r\nAnd you could still use Wordpress (or something better for security) by linking to it like I do on highcountryrc.com ...\r\n\r\nPop\r\n\r\nP.S. I haven''t seen anything new that doesn''t look like something you added.  How many folks have you included in this beta?  There are a shitload of DLG pilots that are active on RCGroups, some of whom you''ve met (Utah, Arizona), and the Blue Skies series is starting in June (Colorado first).\r\n\r\n>Hey pop!\r\n>\r\n>Do you mean a blog about this site? or a blog for club admins to use for their clubs?\r\n>\r\n>I actually started off with the site being wrapped by worpdress, but I had to do too many hacks to run my own stuff in the middle of it. Plus, wordpress is just full of security holes, and I had a bunch of add-on modules, etc...\r\n>\r\n>Just didn''t want to deal with it any longer, so I built my own registration, login, user tracking etc.. system.\r\n>\r\n>But yeah, I think that a blog about this site that shows any new developments would be good...\r\n>\r\n>t\r\n>\r\n>\r\n>>Create a blog that''s updated at least weekly so folks will come back to see what''s happening. ', 1, 1),
(11, 2, 12, '2013-05-10 06:56:30', 'Feeback Form Submission', 'Tim,\r\nThis is really impressive! ', 1, 1),
(12, 12, 2, '2013-05-10 10:06:48', 'RE: Feeback Form Submission', 'Thanks Dave!\r\n\r\nDid you get logged in ok and get linked to the David Cortina that is already in the database with your events and all?\r\n\r\nt\r\n\r\n\r\n>Tim,\r\n>This is really impressive! ', 0, 1);
