Best Practice e Silver Bullet";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://wordpress.tv/?p=17326";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:106:"http://wordpress.tv/2013/03/07/luca-bartoli-sviluppare-plugin-per-wordpress-best-practice-e-silver-bullet/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:735:"<div id="v-RxUKTwkX-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/17326/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/17326/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=17326&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2013/03/07/luca-bartoli-sviluppare-plugin-per-wordpress-best-practice-e-silver-bullet/"><img alt="Luca Bartoli: Sviluppare plugin per WordPress, Best Practice e Silver Bullet" src="http://videos.videopress.com/RxUKTwkX/video-0919b4b753_scruberthumbnail_1.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 07 Mar 2013 15:49:33 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"WordPress.tv";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:39;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:48:"WordPress.tv Blog: Meet the Moderators: Phil Erb";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://wptvblog.wordpress.com/?p=234";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:50:"http://wptvblog.wordpress.com/2013/03/07/phil-erb/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4346:"<p>In the last posts, we chatted with <a title="Meet the Moderators: ChandraMaharzan" href="http://wptvblog.wordpress.com/2013/02/20/chandra-maharzan/" target="_blank">Chandra Maharzan</a>and <a title="Meet the Moderators: JerryBates" href="http://wptvblog.wordpress.com/2013/02/20/jerry-bates/" target="_blank">Jerry Bates</a>, two moderators at<a href="http://wordpress.tv/" target="_blank">WordPress.tv</a>. We&#8217;d like to introduce a third volunteer on this team. Everyone, meet Phil Erb.</p>\n<p><span id="more-234"></span></p>\n<h3>Phil Erb<br />\nScranton, Pennsylvania</h3>\n<h4><img class="alignleft size-medium wp-image-254" alt="Phil Erb" src="http://wptvblog.files.wordpress.com/2013/02/phil.jpg?w=300&h=225" width="300" height="225" /></h4>\n<h4>Tell us a bit about yourself.</h4>\n<p>I&#8217;m a systems administrator/programmer at the University of Scranton. While I do some work with WordPress at the university, most of my WordPress projects are after hours as a consultant or just for fun.</p>\n<h4>How did you get involved with WordPress?</h4>\n<p>I&#8217;ve been creating websites since 2002 &#8212; the<a href="http://philerb.com/" target="_blank">philerb.com</a>domain name turned 10 years old in September! &#8212; originally purely by hand, then by creating very basic CMS-type systems with Perl, PHP, and MySQL. I&#8217;d installed WordPress in 2007 and 2008 to play with it, but never had time to sit down and learn it. It wasn&#8217;t until just before 3.0 came out that I convinced myself custom-coded solutions aren&#8217;t the way to go.Now, I&#8217;m consulting on the side and working on WordPress sites for nonprofits and small businesses.</p>\n<p>I didn&#8217;t really become involved with the WordPress community until last fall. Last year, I began following more WordPress folks on Twitter and started answering questions in the forums. I attended my first WordCamp &#8211;<a href="http://central.wordcamp.org/wordcamps/wordcamp-philly/" target="_blank">WordCamp Philly</a> &#8212; in October.<strong></strong>I&#8217;ve helped set up a <a href="http://www.nepawp.com" target="_blank">Northeast Pennsylvania WordPress meetup</a> &#8212; we had our firstmeetup recently in Scranton and are planning our next one for March 26. (We can be foundon <a href="http://www.meetup.com/nepawp/" target="_blank">Meetup.com</a>oron Twitter <a href="https://twitter.com/nepawp" target="_blank">@nepawp</a>.)</p>\n<p>For WordPress 3.5, I published my first plugin (<a href="http://wordpress.org/extend/plugins/disable-xml-rpc/" target="_blank">Disable XML-RPC</a>).It&#8217;s a simple one-line plugin, but it&#8217;s left me wanting to create more. I&#8217;ve set a goal to contribute at least one thing to core in 2013.</p>\n<h4><span>Why do you want to be a WordPress.tv moderator?</span></h4>\n<p>I&#8217;ve only been to one WordCamp so far, but I love watching the videos from other conferences. They&#8217;ve helped me understand how much you can do with WordPress and inspire me in my own projects. I wanted to get more involved in the community so was very excited when I read about the need for moderators for <a href="http://wordpress.tv/" target="_blank">WordPress.tv</a>. I now have a (good) excuse to sit down and watch videos about WordPress, by some of the best in the business, every day.</p>\n<h4>What other things do you like to do?</h4>\n<p>When I&#8217;m not immersed in code or following the WordPress universe via Twitter on my phone, I&#8217;m playing with (and wrangling) my two kids: three-year-old Adam and one-year-old Rachel.</p>\n<p><i>If you&#8217;re interested in getting involved in WordPress events, such as WordCamps and WordPress meetups, check out the </i><a href="http://make.wordpress.org/events/"><i>Making WordPress Events</i></a><i> discussion forum. You can also see what Phil and the WordPress.tv moderators are up to at </i><a href="http://wptvmods.wordpress.com/"><i>wptvmods</i></a><i>.</i></p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/234/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/234/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wptvblog.wordpress.com&blog=5310177&post=234&subd=wptvblog&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 07 Mar 2013 08:01:47 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Cheri Lucas";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:40;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:57:"Weblog Tools Collection: WordPress Theme Releases for 3/6";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12737";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~