_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:84:"Lorelle on WP: Introduction to WordPress Class at Clark College Continuing Education";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://lorelle.wordpress.com/?p=8253";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:110:"http://lorelle.wordpress.com/2013/03/05/introduction-to-wordpress-class-at-clark-college-continuing-education/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:520:"I will be teaching another Introduction to WordPress course at Clark College Corporate and Continuing Education in Vancouver, Washington, starting Saturdays, April 27 through July 13, 2013. The class will be at the Columbia Tech Center in eastern Vancouver, just across the Columbia River off Interstate 205, just a few minutes from downtown Portland, Oregon. [...]<img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=lorelle.wordpress.com&blog=72&post=8253&subd=lorelle&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 05 Mar 2013 21:13:45 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"Lorelle VanFossen";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:43;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:56:"WordPress.tv Blog: Meet the Moderators: Chandra Maharzan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://wptvblog.wordpress.com/?p=231";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:58:"http://wptvblog.wordpress.com/2013/03/05/chandra-maharzan/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4316:"<p>In last week&#8217;s post, we talked to <a title="Meet the Moderators: JerryBates" href="http://wptvblog.wordpress.com/2013/02/20/jerry-bates/" target="_blank">Jerry Bates</a>, one of the moderators at <a href="http://wordpress.tv/" target="_blank">WordPress.tv</a>. Let&#8217;s continue our &#8220;Meet the Moderators&#8221; Q&amp;A series with another member of this team, hailing all the way from Nepal: Chandra Maharzan.</p>\n<p><span id="more-231"></span></p>\n<h3>Chandra Maharzan<br />\nKathmandu, Nepal</h3>\n<h4><img class="size-medium wp-image-248 alignright" alt="Chandra Maharzan" src="http://wptvblog.files.wordpress.com/2013/02/chandra.jpg?w=225&h=300" width="225" height="300" />Tell us about yourself and your work.</h4>\n<p>I&#8217;m a theme designer, and since 2008 I&#8217;ve worked at <a href="http://graphpaperpress.com/" target="_blank">Graph Paper Press</a> to produce photography themes. Some of my themes have been on &#8220;top 100 free WP themes&#8221; lists on sites like<em><a href="http://www.smashingmagazine.com/">Smashing Magazine</a>,</em>and<a href="http://theme.wordpress.com/themes/gridspace/" target="_blank">Gridspace</a> &#8212; one of the themes I crafted &#8212; is the 10th most popular theme in WordPress.com&#8217;s <a href="http://theme.wordpress.com/" target="_blank">Theme Showcase</a>. I currently have three free themes at WordPress.org, and one of them, <a href="http://theme.wordpress.com/themes/book-lite/" target="_blank">Book Lite</a>, is now available on WordPress.com, too.I also create minimal themes at <a href="http://www.wpshoppe.com/" target="_blank">WPshoppe</a> and review themes at <a href="http://wordpress.org/" target="_blank">WordPress.org</a>.</p>\n<p>In 2011, I set up a WordPress group in Kathmandu, and we meet monthly. We organized our first <a href="http://2012.nepal.wordcamp.org/" target="_blank">WordCamp Nepal</a> in November, which was pretty awesome!</p>\n<p><em></em><em>Pictured at right: Chandra (right) with Philip Arthur Moore, theme wrangler at <a href="http://automattic.com/" target="_blank">Automattic</a>, in WordCamp Nepal.</em></p>\n<h4>How did you get involved with WordPress?</h4>\n<p>I began using WordPress extensively for client projects. I, along with others, thought that if WordPress was so efficient, time-saving, and cost-effective, we should share our experience with others. In April 2011, we had our first WordPress meetup with just four people. We created a Facebook group and soon after found people who were really into WordPress. While the group didn&#8217;t expand that much, we continued our monthly meetups. In August 2011, I was able to go to WordCamp San Francisco &#8212; an eye opener! I was determined to do a WordCamp in Kathmandu, so that&#8217;s how it started. We now have over 600 people in the group, and students in colleges are excited to start WordPress clubs.</p>\n<h4>Why do you want to be a WordPress.tv moderator?</h4>\n<p>I have learned many new things from the videos at <a href="http://wordpress.tv/" target="_blank">WordPress.tv</a>. But I do wish the videos were more interactive (with slides), and had high-quality sound. So, as a listener, sometimes you get lost. I want to improve our future videos and make WordPress.tvthe best resource for WordPress! I want to help the WordPress community beyond the local level.</p>\n<h4>What other things do you like to do?</h4>\n<p>I have a baby girl who takes up a lot of my time. I also keep busy photographing and making music.</p>\n<p><i>Stay tuned for the next Q&amp;A in this series! If you&#8217;re interested in getting involved in WordPress events, such as WordCamps and WordPress meetups, check out the </i><a href="http://make.wordpress.org/events/"><i>Making WordPress Events</i></a><i> discussion forum. You can also see what Chandra and the WordPress.tv moderators are up to at </i><a href="http://wptvmods.wordpress.com/"><i>wptvmods</i></a><i>.</i></p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/231/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/231/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wptvblog.wordpress.com&blog=5310177&post=231&subd=wptvblog&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 05 Mar 2013 18:00:15 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Cheri Lucas";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:44;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Plugin Releases for 3/4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12733";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/sSMZLJ7BZjc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1710:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/eshop-shipping-extension/"><strong>eShop Shipping Extension</strong></a> overrides <a href="http://wordpress.org/extend/plugins/eshop/">eShop&#8217;s</a> default shipping methods, interacting directly with Canada Post, UPS, USPS, Fedex, and Correios for real-time shipping rates and services.</p>\n<p><a href="http://wordpress.org/extend/plugins/genericond/"><strong>Genericon&#8217;d</strong></a> enables easy use of the <a href="http://genericons.com">Genericons</a> icon font set from within WordPress. Icons can be inserted using either HTML or a shortcode.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/backwpup/"><strong>BackWPup</strong></a> allows you to backup your WordPress database, files, and more.</p>\n<p><a href="http://wordpress.org/extend/plugins/facebook/"><strong>Facebook</strong></a> makes your site deeply social by integrating functionality from Facebook.</p>\n<p><a href="http://wordpress.org/extend/plugins/posterous-importer/"><strong>Posterous Importer</strong></a> imports posts, comments, tags, and attachments from a Posterous.com blog.</p>\n<p><a href="http://www.viper007bond.com/wordpress-plugins/syntaxhighlighter/"><strong>SyntaxHighlighter Evolved</strong></a> allows you to easily post syntax-highlighted code to your site without having to escape the code or anything.</p>\n<p><a href="http://wordpress.org/extend/plugins/watu/"><strong>Watu</strong></a> allows you to create exams with unlimited questions and answers, and define grades based on collected points.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/sSMZLJ7BZjc" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon