";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"WordPress.tv";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:47;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:21:"Alex King: Social 2.8";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=15918";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:46:"http://alexking.org/blog/2013/03/01/social-2-8";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1380:".threads-post-notice {\n	background: #e8e8e8;\n	padding: 10px;\n}\n.threads-post-notice a {\n	font-weight: bold;\n}\n\n<p><a href="http://wordpress.org/extend/plugins/social/">Social 2.8</a> (courtesy of <a href="http://mailchimp.com">MailChimp</a>) was released today. This release was primarily to change over to using version 1.1 of Twitter&#8217;s API.</p>\n<p>Why should you care? Well, for one thing &#8211; the 1.0 API was starting to break and not get repaired in places. For example, you might have noticed that Social was no longer reliably finding tweets that referenced your posts by URL. This was due to a breakage in Twitter&#8217;s 1.0 search API. However, it works fine in the 1.1 API &#8211; now that is &#8220;fixed&#8221;. Yay!</p>\n<p>So we&#8217;re pleased to be on Twitter&#8217;s 1.1 API, and the great folks at MailChimp have made some additional changes to the Social Proxy to make it easier for us to maintain Twitter API compatibility going forward.</p>\n<p>We also threw in a couple of little bug fixes, check out the <a href="http://wordpress.org/extend/plugins/social/changelog/">changelog</a> in the README for details.</p>\n<p>Enjoy!</p>\n<p class="threads-post-notice">This post is part of the thread: <a href="http://alexking.org/blog/thread/social">Social</a> &#8211; an ongoing story on this site. View the thread timeline for more context on this post.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 02 Mar 2013 00:12:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:48;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:21:"Joseph: HTML Purifier";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"https://josephscott.org/?p=6627";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:54:"http://josephscott.org/archives/2013/03/html-purifier/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1282:"<p><a href="https://sharedat.net/s/fCDw"><img src="https://sharedat.net/f/fC/fCDw/html-purifier.png" width="505" height="168" class="aligncenter" /></a></p>\n<p>In the world of HTML filtering in PHP <a href="http://htmlpurifier.org/">HTML Purifier</a> appears to be the current top dog.  WordPress long ago forked <a href="http://sourceforge.net/projects/kses/">kses</a> for HTML filtering, which is fine, but as <a href="http://urbangiraffe.com/">John Godley</a> ( a co-worker at <a href="http://automattic.com/">Automattic</a> ) put it:</p>\n<blockquote><p>\nThere is nothing fundamentally wrong with the way WordPress and bbPress filters comments, and in fact there has been no security alert related to this. However, this doesnt detract from the desire to make things better, and the fact that HTML Purifier is much more thorough and exhaustive.\n</p></blockquote>\n<p>He wrote the <a href="http://wordpress.org/extend/plugins/html-purified/">HTML Purified WordPress plugin</a>, which &#8220;replaces the default WordPress comments filters with HTML Purifier&#8221;.</p>\n<p>For new PHP projects, or ones that allow you to easily swap in/out libraries, it looks like HTML Purifier is the current <a href="http://htmlpurifier.org/comparison">best option for HTML filtering</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 01 Mar 2013 21:15:13 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Joseph Scott";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:49;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:57:"Weblog Tools Collection: WordPress Theme Releases for 3/1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12725";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/oIidvqpyMIY/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1848:"<p><a href="http://themes.vorkshop.com/boiler/"><img class="alignnone size-thumbnail wp-image-12729" alt="boiler" src="http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/03/boiler.png?resize=150%2C150" /></a></p>\n<p><a href="http://themes.vorkshop.com/boiler/"><strong>Boiler</strong></a> is a free responsive HTML5 boilerplate theme.</p>\n<p><a href="http://emptynestthemes.com/2013/02/28/fluid-wordpress-professional-website-theme/"><img class="alignnone size-thumbnail wp-image-12726" alt="DemoBlog" src="http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/03/DemoBlog.png?resize=150%2C150" /></a></p>\n<p><a href="http://emptynestthemes.com/2013/02/28/fluid-wordpress-professional-website-theme/"><strong>Fluid</strong></a> is a professional, elegant, vibrant, yet fairly simple corporate or business theme that uses varying shades of blue, silver, gray, and white with a semi-abstract water ripple header image that could be easily changed.</p>\n<p><a href="http://wordpress.org/extend/themes/spine"><img class="alignnone size-thumbnail wp-image-12727" alt="screenshot" src="http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/03/screenshot.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/spine"><strong>Spine</strong></a> is a white, grey, black, and blue two-column theme.</p>\n<p><a href="http://wordpress.org/extend/themes/zeenews"><img class="alignnone size-thumbnail wp-image-12728" alt="screenshot-1" src="http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/03/screenshot-1.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/zeenews"><strong>zeeNews</strong></a> is a theme for any news, magazine, or blog.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/oIidvqpyMIY" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 01 Mar 2013 17:45:45 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}}}}}}}}}}s:4:"type";i:128;s:7:"headers";a:9:{s:6:"server";s:5:"nginx";s:4:"date";s:29:"Sat, 16 Mar 2013 05:54:14 GMT";s:12:"content-type";s:8:"text/xml";s:14:"content-length";s:5:"85728";s:10:"connection";s:5:"close";s:4:"vary";s:15:"Accept-Encoding";s:13:"last-modified";s:29:"Sat, 16 Mar 2013 05:45:15 GMT";s:4:"x-nc";s:11:"HIT luv 138";s:13:"accept-ranges";s:5:"bytes";}s:5:"build";s:14:"20130212062018";}', 'no');
