36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:79:"http://www.graphene-theme.com/announcement/graphene-mobile-on-sale-15-off/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:39:"Must do tweaks for every WordPress site";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:77:"http://www.graphene-theme.com/how-to/must-do-tweaks-for-every-wordpress-site/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:86:"http://www.graphene-theme.com/how-to/must-do-tweaks-for-every-wordpress-site/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 18 Oct 2012 09:06:49 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:6:"How To";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://www.graphene-theme.com/?p=432";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:471:"WordPress works great out of the box, but it doesn&#8217;t mean you can&#8217;t make it better. Themes and plugins are the obvious add-ons to customise your site and make it yours. But there are also some settings in WordPress that you should change for every site you create to make your it better. These are &#8230; </p><p><a class="more-link block-button" href="http://www.graphene-theme.com/how-to/must-do-tweaks-for-every-wordpress-site/">Continue reading &#187;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Syahir Hakim";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4132:"<p>WordPress works great out of the box, but it doesn&#8217;t mean you can&#8217;t make it better. Themes and plugins are the obvious add-ons to customise your site and make it yours. But there are also some settings in WordPress that you should change for every site you create to make your it better.</p>\n<p>These are easy changes, most of which require no additional plugins or themes to install. They&#8217;re right there in your WordPress dashboard. Making these changes will instantly make your site a little bit better, and give you that &#8220;feel good&#8221; factor.</p>\n<p><span id="more-432"></span></p>\n<h3>1. Permalink</h3>\n<p>The default WordPress permalink (the link to your posts and pages) isn&#8217;t pretty. It looks something like this:<br />\n<a href="http://www.graphene-theme.com/?p=432">http://www.graphene-theme.com/?p=432</a></p>\n<p>A pretty permalink looks something like this:<br />\n<a href="http://www.graphene-theme.com/how-to/must-do-tweaks-for-every-wordpress-site/"> http://www.graphene-theme.com/how-to/must-do-tweaks-for-every-wordpress-site/</a></p>\n<p>Why does it matter? Well, aside from aesthetics, it&#8217;s friendlier to search engines and to your site&#8217;s visitors. When people share the link to the post, they&#8217;ll instantly know what it&#8217;s about.</p>\n<p>Permalink settings can be changed in <strong>WP Admin &gt; Settings &gt; Permalinks</strong>.</p>\n<h3>2. Author name</h3>\n<p>I cringe every time I see websites whose posts have a byline that reads: &#8220;<strong>by admin</strong>&#8220;. It&#8217;s terrible. If you care the slightest bit about your site and it&#8217;s presentation, change that. Change that to something more personal, more creative, more whatever, as long as it&#8217;s not <em>admin</em>.</p>\n<p>Unless of course, you&#8217;re running a multi-author site and you are indeed, the admin. But still, you can change it to &#8220;The Cranky Administrateur&#8221;, or something. Anything.</p>\n<p>You can change your display name by going to <strong>WP Admin &gt; Users &gt; Your Profile</strong>.</p>\n<h3>3. Don&#8217;t publish your email address</h3>\n<p>Cause if you do, it won&#8217;t be long before your inbox is flooded with offers of cialis and viagra. Seriously, publishing your email address online is just like dangling bait for spambots. Except it isn&#8217;t bait. It&#8217;s your inbox with no hook attached.</p>\n<div class="pullquote alignleft" style="width:45%;text-align:center;"><p>Seriously, publishing your email address online is just like dangling bait for spambots. Except it isn&#8217;t bait. It&#8217;s your inbox with no hook attached.</p>\n</div>\n<p>Use a contact form instead. There are a lot of good free plugins that will let you create a contact form in just a few clicks. My favourite free plugin for this is <a href="http://wordpress.org/extend/plugins/contact-form-7/">Contact Form 7</a>. Favourite premium plugin? <a title="Link to Gravity Forms website" href="http://www.graphene-theme.com/forward/gravityforms" target="_blank">Gravity Forms</a>.</p>\n<p>If you absolutely have to publish your email, use an email obfuscator plugin. This plugin scrambles the HTML code for any email addresses you publish so that they are more difficult to be recognised by spambots, while retaining the look and functionality of the email link to your site&#8217;s visitors. My recommended plugin for this is <a href="http://wordpress.org/extend/plugins/obfuscate-email/">Email Obfuscator</a>.</p>\n<h3>4. Turn off navigation menu description if you&#8217;re not using it</h3>\n<p>This one is specific to the Graphene theme, which comes with a feature that allows you to insert short description for each menu item. But if you&#8217;re not using that feature, go to <strong>Graphene Options &gt; Display &gt; Navigation Menu Display Options</strong>, and tick the &#8220;Disable description in Header Menu&#8221; option.</p>\n<p>Those are the more obvious ones that I can remember for now. I&#8217;m sure there are many others, but my mental notes seem to be missing at this time. Feel free to share your own tips in the comments section.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:82:"http://www.graphene-theme.com/how-to/must-do-tweaks-for-every-wordpress-site/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:44:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:46:"Child theme functionality with Graphene Mobile";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://www.graphene-theme.com/how-to/child-theme-functionality-with-graphene-mobile/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:93:"http://www.graphene-theme.com/how-to/child-theme-functionality-with-graphene-mobile/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 30 Aug 2012 10:00:25 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:17:"Feature Highlight";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:6:"How To";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://www.graphene-theme.com/?p=421";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:500:"Child themes are great. They allow you to customise a parent theme without ever needing to edit the parent theme&#8217;s files. However, due to the way most mobile theme switcher plugins work, you can&#8217;t use child theme with Graphene Mobile the way you usually can with standard desktop themes. This is because the child theme &#8230; </p><p><a class="more-link block-button" href="http://www.graphene-theme.com/how-to/child-theme-functionality-with-graphene-mobile/">Continue reading &#187;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Syahir Hakim";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2478:"<p>Child themes are great. They allow you to customise a parent theme without ever needing to edit the parent theme&#8217;s files. However, due to the way most mobile theme switcher plugins work, you can&#8217;t use child theme with Graphene Mobile the way you usually can with standard desktop themes. This is because the child theme won&#8217;t be loaded when the mobile theme is loaded.</p>\n<p>However, the Graphene Mobile theme has a feature implemented in it that allows you to have child theme-like functionality. In this post, I will explain how you can use this lesser known feature.</p>\n<p><span id="more-421"></span></p>\n<h3>Child themes and Graphene Mobile</h3>\n<p>Two of the most commonly used files in a child theme is the style.css and the functions.php file. The style.css file is where you place all your custom css styles, whereas the functions.php file is where you place all your custom PHP functions. Child themes also allow you to override the parent theme&#8217;s templates, but most of the time you don&#8217;t need them to. In fact, I wouldn&#8217;t even recommend it, for reasons that you can read about <a href="http://docs.graphene-theme.com/Customisation_using_a_child_theme#Special_consideration">here</a>.</p>\n<p>With Graphene Mobile, you can have it load a custom style.css and functions.php files without actually creating a child theme for it. But those are all the custom files it will load. It would not load any other files unless you specifically <code>include()</code> or <code>require()</code> them in the custom functions.php file, or if you <code>import()</code> them in the custom style.css file. It would not also replace any of its template files with any custom template files you may create.</p>\n<h3>The How To</h3>\n<p>In order to have the Graphene Mobile theme load up the custom style.css and functions.php files, all you need to do is place those files in the <code>wp-content/uploads/graphene-mobile-custom/</code>. Graphene Mobile will then check if those files exist, and load them if they do.</p>\n<p>Like normal child themes, the style.css file will be loaded after the theme&#8217;s style.css file, whereas the functions.php file is will be loaded before the theme&#8217;s own functions.php file. This allows you to override the theme&#8217;s styles and functions more easily.</p>\n<p>I would love to hear your thoughts on this feature, so if you have any comments or suggestions, make sure you submit them below. Enjoy!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:89:"http://www.graphene-theme.com/how-to/child-theme-functionality-with-graphene-mobile/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:38:"Graphene 1.8.1 and Graphene Mobile 1.2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://www.graphene-theme.com/announcement/graphene-181-and-graphene-mobile-12/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:88:"http://www.graphene-theme.com/announcement/graphene-181-and-graphene-mobile-12/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 15 Aug 2012 09:44:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:12:"Announcement";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://www.graphene-theme.com/?p=411";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:561:"I&#8217;m glad to announce that Graphene 1.8.1 is now available from the WordPress.org themes repository. You can update your version of Graphene using WordPress built-in theme update feature. Graphene 1.8 brings an expanded colour options, including the much-anticipated options to customise the menu. We&#8217;ve also incorporated some performance improvements by reducing the number of database &#8230; </p><p><a class="more-link block-button" href="http://www.graphene-theme.com/announcement/graphene-181-and-graphene-mobile-12/">Continue reading &#187;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Syahir Hakim";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3750:"<p>I&#8217;m glad to announce that Graphene 1.8.1 is now available from the WordPress.org themes repository. You can update your version of Graphene using WordPress built-in theme update feature.</p>\n<p>Graphene 1.8 brings an expanded colour options, including the much-anticipated options to customise the menu. We&#8217;ve also incorporated some performance improvements by reducing the number of database queries per page load by up to half the previous number. Then there&#8217;s the UX improvement in the theme&#8217;s options page including AJAX saving to speed up the process of setting up the theme or trying out the different options.</p>\n<p>There are also a few design updates, particularly with regard to the widget header fonts and the slider navigation circles. These design updates were made to serve two purposes: apart from refreshing the design to make the theme look more modern, they also make the theme&#8217;s elements play better with any colour customisation you may implement.</p>\n<p>Graphene 1.8.1 fixes quite a few issues with Graphene 1.8 that slipped past the beta testing period. Thanks to all the theme users who have reported the issues at the Support Forum and helped us to identify and fix the bugs.</p>\n<p>You can see the full list of changes in the theme&#8217;s <a title="Changelog" href="http://www.graphene-theme.com/documentation/changelog/">changelog</a>.</p>\n<h3>Graphene Mobile 1.2</h3>\n<p>Following the release of Graphene 1.8.1 is an update to Graphene Mobile, which has been in the works for quite some time now. This update includes adding the popular Action Hooks Widget Areas feature to Graphene Mobile. Following the update in Graphene 1.8, the Graphene Mobile options in the options page are also now saved via AJAX for speedy interaction.</p>\n<p>Another issue with mobile sites is the limitation on the number of menu items you can use before the menu starts taking up too much precious mobile real estate. Graphene Mobile have addressed this partially in the past by adding Custom Menu locations that are separate from the desktop theme, so that you can use a different set of menu for mobile devices. But if you absolutely need to have a lot of menu items to be displayed even on mobile devices, Graphene Mobile 1.2 now has a feature where you can use the HTML <code>&lt;select&gt;</code> element to display the menu. This effectively eliminates the limit on the number of menu items that can be used without crowding the layout.</p>\n<p>Here&#8217;s the full list of changes for Graphene Mobile 1.2:</p>\n<ul>\n<li>Added <code>[ mobile-only ]</code> and <code>[ mobile-exclude ]</code> shortcodes</li>\n<li>Added Action Hook Widget Areas option</li>\n<li>Added custom <code>&lt;head&gt;</code> tags option</li>\n<li>Added option to use the &lt;select&gt; element for menus, effectively eliminating the limit on the number of menu items that can be used without crowding the layout</li>\n<li>Allow users with <code>edit_theme_options</code> capability to modify and save theme options</li>\n<li>Moved colour options into a separate options tab</li>\n<li>Theme options are now saved via AJAX, with fallback to non-AJAX alternative</li>\n</ul>\n<p>Graphene Mobile 1.2 is available immediately for automatic update. Make sure you enter your Graphene Mobile API key in the Graphene Mobile options page for the automatic update to work.</p>\n<p>Oh, and in case you don&#8217;t know yet, you can give both the <a title="Admin testdrive" href="http://www.graphene-theme.com/admin-testdrive/">Graphene theme and Graphene Mobile theme a testdrive</a> before you install them yourself.</p>\n<p>Enjoy <img src=''http://www.graphene-theme.com/wp-includes/images/smilies/icon_smile.gif'' alt='':)'' class=''wp-smiley'' /> </p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:84:"http://www.graphene-theme.com/announcement/graphene-181-and-graphene-mobile-12/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:38:"Graphene 1.8a (alpha) is now available";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:80:"http://www.graphene-theme.com/announcement/graphene-1-8a-alpha-is-now-available/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:89:"http://www.graphene-theme.com/announcement/graphene-1-8a-alpha-is-now-available/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 17 Jul 2012 03:20:26 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:12:"Announcement";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://www.graphene-theme.com/?p=401";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:550:"I&#8217;m glad to announce that an alpha version of Graphene 1.8 is now available for download. You can get the package from here: http://code.google.com/p/graphene/downloads/detail?name=graphene-1.8a.zip Since this is an alpha release, it is meant for testing and translating purposes only. Please do not use this version on a critical production site. There may be undiscovered nasty &#8230; </p><p><a class="more-link block-button" href="http://www.graphene-theme.com/announcement/graphene-1-8a-alpha-is-now-available/">Continue reading &#187;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Syahir Hakim";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4611:"<p><span><span style="font-family: Arial;">I&#8217;m glad to announce that an alpha version of Graphene 1.8 is now available for download. You can get the package from here: <a href="http://code.google.com/p/graphene/downloads/detail?name=graphene-1.8a.zip">http://code.google.com/p/graphene/downloads/detail?name=graphene-1.8a.zip</a></span></span></p>\n<p><span><span style="font-family: Arial;">Since this is an alpha release, it is meant for testing and translating purposes only. Please do not use this version on a critical production site. There may be undiscovered nasty bugs in the codes. </span></span></p>\n<p><span><span style="font-family: Arial;">But if your site is not very critical, or if you can set up a test site whether online or locally, you are most welcome to join in the testing. The more testers we have, the less chances there are that some bugs will slip the net. If you do join in the testing, make sure you join the theme&#8217;s developers, testers, and translators <a href="https://groups.google.com/forum/?fromgroups#!forum/graphene-theme-dev">Google Groups</a> so that we can consolidate all reports in one place.</span></span></p>\n<h3><span style="font-family: Arial;">For translators</span></h3>\n<p><span><span style="font-family: Arial;"><strong></strong>There are currently 112 new strings, and 52 obsolete ones. You can update your translation using POEdit and the /languages/graphene.pot file. If you&#8217;re new to the translation, detailed instructions is available here: <a href="http://docs.graphene-theme.com/Translating_the_theme" target="_blank">http://docs.graphene-theme.com/Translating_the_theme</a>. </span></span><span><span style="font-family: Arial;">Nearly half of the new strings are really just small updates of the deprecated ones, so those shouldn&#8217;t be too much work to translate. POEdit should have already automatically translated these strings and marked them as fuzzy.</span></span></p>\n<h3><span><span style="font-family: Arial;">For developers and testers</span></span></h3>\n<p><span><span style="font-family: Arial;">This is a major update, which means it contains a few major changes to the theme&#8217;s codes, major new features, and bugfixes. Some of the new features include the ability to extend the slider to the full width of the theme, and the colour of the navigation menus can also be customised via the theme&#8217;s options page, which by the way, is now saved via AJAX for speedy interaction. </span></span></p>\n<p><span><span style="font-family: Arial;">Another rather important update is the compatibility improvements with <a href="http://wordpress.org/extend/plugins/wp-e-commerce/">WP e-Commerce</a>, so if you could perform extensive tests with the e-commerce plugin installed, that would be greatly appreciated. E-commerce plugins are usually very complex plugins, and they tend to employ their own sub-theme to display the contents produced by the plugin, which often doesn&#8217;t work well with most themes except the two default themes that come with WordPress. With regard to e-commerce compatibility, I&#8217;ve adopted an on-going improvements approach, where the aim is to not provide flawless compatibility right out of one update, but continuous improvements over multiple updates.</span></span></p>\n<p><span><span style="font-family: Arial;">Performance-wise, there has been some major improvements as well. The number of database queries has been reduced by as much as half for each page load (this mainly has to do with the navigation menus). As part of the performance improvements, the theme&#8217;s custom fields for each posts and pages are now stored as just a single database entry to reduce the number of queries. This release includes an update script that silently consolidates all previous custom field entries that the theme added to the database for each posts and pages.</span></span></p>\n<p><span><span style="font-family: Arial;">To see a list of other changes and bugfixes, please see the latest changelog.txt in trunk: <a href="http://code.google.com/p/graphene/source/browse/trunk/graphene/changelog.txt" target="_blank">http://code.google.com/p/graphene/source/browse/trunk/graphene/changelog.txt</a></span></span></p>\n<p><span><span style="font-family: Arial;">Please also report all bugs and issues, as well as missing strings for translations via the <a href="https://groups.google.com/forum/?fromgroups#!forum/graphene-theme-dev">mailing list</a> so that everyone receives it.</span></span></p>\n<p><span><span style="font-family: Arial;">Thanks, and happy testing!</span></span></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:85:"http://www.graphene-theme.com/announcement/graphene-1-8a-alpha-is-now-available/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:43:"Interview with the Graphene theme developer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:87:"http://www.graphene-theme.com/announcement/interview-with-the-graphene-theme-developer/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s