theme-developer/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:45:"Feature preview: pullquote and Google Webfont";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:91:"http://www.graphene-theme.com/feature-preview/feature-preview-pullquote-and-google-webfont/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:100:"http://www.graphene-theme.com/feature-preview/feature-preview-pullquote-and-google-webfont/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 15 Jun 2012 05:35:53 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:15:"Feature Preview";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://www.graphene-theme.com/?p=346";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:505:"Starting from version 1.7.3, a new feature will be added to the Graphene theme, called pullquote. What is a pullquote? It&#8217;s that enlarged block of text you usually see in magazine articles. This screenshot would explain it better than any words can: The pullquote has been implemented as a shortcode that you can easily use &#8230; </p><p><a class="more-link block-button" href="http://www.graphene-theme.com/feature-preview/feature-preview-pullquote-and-google-webfont/">Continue reading &#187;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Syahir Hakim";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3816:"<p>Starting from version 1.7.3, a new feature will be added to the Graphene theme, called <strong>pullquote</strong>.</p>\n<div class="important_block message-block"><p class="printonly"><strong>Important!</strong></p>Graphene 1.7.3 has been released and the features described in this post are now available.</div>\n<p>What is a pullquote? It&#8217;s that enlarged block of text you usually see in magazine articles. This screenshot would explain it better than any words can:</p>\n<p style="text-align: left;"><a href="http://www.graphene-theme.com/wp-content/uploads/graphene-pullquote.png" rel="lightbox[346]"><img class="aligncenter  wp-image-347" title="A pullquote" src="http://www.graphene-theme.com/wp-content/uploads/graphene-pullquote-300x197.png" alt="" width="300" height="197" /></a><span id="more-346"></span>The pullquote has been implemented as a shortcode that you can easily use in the WordPress Editor. There will also be a button in the editor that&#8217;ll quickly add the shortcode for you:</p>\n<p style="text-align: left;"><a href="http://www.graphene-theme.com/wp-content/uploads/grpahene-pullquote-mce.png" rel="lightbox[346]"><img class="aligncenter size-medium wp-image-348" title="The pullquote shortcode and button (in red outline) in the WordPress Editor" src="http://www.graphene-theme.com/wp-content/uploads/grpahene-pullquote-mce-300x73.png" alt="" width="300" height="73" /></a>As you can see in the screenshot above, the pullquote button will automatically wrap selected text in the pullquote shortcode. The shortcode itself accepts two parameters: <strong>align</strong> and <strong>width</strong>. The default value for width is 30%, which is added by default to the shortcode, but you can change it to any CSS width value, e.g. 100% for full width, or 250px, 10em, etc.</p>\n<p>The align parameter accepts three values: left, center, or right. This allows you to determine the alignment of the pullquote in the post.</p>\n<div id="attachment_349" class="wp-caption aligncenter" style="width: 282px"><a href="http://www.graphene-theme.com/wp-content/uploads/pullquote-variations.png" rel="lightbox[346]"><img class="size-medium wp-image-349" title="Different variations of the pullquote width and alignment." src="http://www.graphene-theme.com/wp-content/uploads/pullquote-variations-272x300.png" alt="" width="272" height="300" /></a><p class="wp-caption-text">Different variations of the pullquote width and alignment.</p></div>\n<p>The text in the pullquote will be styled using the <strong></strong><a href="http://www.google.com/webfonts/specimen/Pontano+Sans">Pontano Sans</a> font from Google Webfont. Since the theme will be loading the font using Google&#8217;s Webfont Loader, it&#8217;s only natural to expand that feature to allow you to add other fonts from Google Webfont from the theme&#8217;s options page. The new option is located in <strong>Graphene Options &gt; Display &gt; Text Style Options</strong>.</p>\n<p style="text-align: left;"><a href="http://www.graphene-theme.com/wp-content/uploads/webfonts-option.png" rel="lightbox[346]"><img class="aligncenter size-medium wp-image-350" title="The new Google Webfonts option" src="http://www.graphene-theme.com/wp-content/uploads/webfonts-option-300x86.png" alt="" width="300" height="86" /></a>As you can probably discern from the screenshots above, these features are pretty much completed. Keep an eye out for the next theme update for these goodies.</p>\n<p style="text-align: left;"><strong>Update 16/6/2012:</strong></p>\n<p style="text-align: left;">The shortcode will also accept another parameter: <strong>textalign</strong>. The acceptable values for this parameter is the same as the <strong>align</strong> parameter: left, center, or right. This will allow you to align the text inside the pullquote.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:96:"http://www.graphene-theme.com/feature-preview/feature-preview-pullquote-and-google-webfont/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"10";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:41:"\n		\n		\n		\n		\n		\n				\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:39:"Welcome to the newly revamped demo site";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:83:"http://www.graphene-theme.com/announcement/welcome-to-the-newly-revamped-demo-site/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:92:"http://www.graphene-theme.com/announcement/welcome-to-the-newly-revamped-demo-site/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 05 May 2012 09:29:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:12:"Announcement";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://www.graphene-theme.com/?p=305";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:523:"When I first made the Graphene theme publicly available, there was little need for a demonstration site. Back then, the number of features were so small that the theme&#8217;s options page was just a normal HTML list of countable options. Today, the theme&#8217;s options span three pages, each containing collapsible sections that categorise the options. &#8230; </p><p><a class="more-link block-button" href="http://www.graphene-theme.com/announcement/welcome-to-the-newly-revamped-demo-site/">Continue reading &#187;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Syahir Hakim";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2895:"<p>When I first made the Graphene theme publicly available, there was little need for a demonstration site. Back then, the number of features were so small that the theme&#8217;s options page was just a normal HTML list of countable options.</p>\n<p>Today, the theme&#8217;s options span three pages, each containing collapsible sections that categorise the options. At this time of writing, the theme is approaching its 500,000th download. Along with this growth &#8211; which is still ongoing &#8211; there was a need to set up a demonstration site so that theme hunters can preview the theme&#8217;s features without having to install the theme first.<span id="more-305"></span></p>\n<p>I know only too well how many themes a new WordPress user typically install before settling on one. And I know it can be frustrating to have to spend so much time figuring out which theme to use, when all you want to do is start penning your thoughts and musings.</p>\n<p>The first demonstration site was set up as a subdomain of my <a href="http://www.khairul-syahir.com/">own blog</a>, and it was poorly organised. Contents were created haphazardly without a clear structure of where things belong. The front page featured a notice saying that the demo site is in development &#8211; a notice that unfortunately never went away.</p>\n<p>At the same time, my own blog became a pseudo-home of the Graphene theme. This in itself is not bad &#8211; the site gained quite a sizable increase in Google PageRank. However, with that status it became less and less suitable for me to pen my own thoughts and musings on my own blog &#8211; and that is a problem. I still want to write on issues other than the Graphene theme. I still want to share photos and experiences with friends and families. But with the Graphene theme&#8217;s users making up the majority of the blog&#8217;s audience, writing posts that don&#8217;t relate to the Graphene theme feels rather inappropriate. At least it does for me.</p>\n<p>So it&#8217;s only appropriate that the theme gets its own home. The move also presents me an opportunity to build the demo site from the ground up, with proper structure and content. After much work, this demo site is the results, and I can say that I&#8217;m quite happy with it.</p>\n<p>So go ahead and play around with it, and if you&#8217;re new to the theme, make sure you try out the <a title="Admin testdrive" href="http://www.graphene-theme.com/admin-testdrive/">admin interface testdrive</a>. That was something I wanted to provide a long time ago, but wasn&#8217;t able to until now.</p>\n<p>And you are all very much welcome to stick around on my blog. I would always appreciate your comments and thoughts on the issues that I brought up.</p>\n<p>Here&#8217;s to a new chapter <img src=''http://www.graphene-theme.com/wp-includes/images/smilies/icon_smile.gif'' alt='':)'' class=''wp-smiley'' /> </p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:88:"http://www.graphene-theme.com/announcement/welcome-to-the-newly-revamped-demo-site/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"10";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:4:"href";s:35:"http://www.graphene-theme.com/feed/";s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:44:"http://purl.org/rss/1.0/modules/syndication/";a:2:{s:12:"updatePeriod";a:1:{i:0;a:5:{s:4:"data";s:6:"hourly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:15:"updateFrequency";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}}}}}}s:4:"type";i:128;s:7:"headers";a:11:{s:6:"server";s:16:"cloudflare-nginx";s:4:"date";s:29:"Mon, 18 Feb 2013 21:08:24 GMT";s:12:"content-type";s:9:"text/html";s:10:"connection";s:5:"close";s:15:"x-mod-pagespeed";s:13:"1.1.23.2-2258";s:13:"cache-control";s:19:"max-age=0, no-cache";s:4:"vary";s:15:"Accept-Encoding";s:12:"x-powered-by";s:8:"PleskLin";s:6:"pragma";s:6:"public";s: