INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1, 1, '2013-02-15 00:00:24', '2013-02-15 08:00:24', '<span style="color: #0000ff;"><strong>Welcome all Pilots and RC Flying enthusiasts!</strong></span>\r\n\r\nI have created this site out of the desire to have a single location where we can have information about flying sites, the planes we fly, and a place for competition information. I hope you will sign up as a user and contribute to the databases however you can, making this a location that everyone can go to when wondering about where they can fly when they are traveling, or if they need crucial data about some different planes.\r\n\r\nPlease let me know what you think, and help me to make this site really belong to our great RC community!\r\n\r\nTim', 'Welcome To The Vault', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2013-02-15 00:44:15', '2013-02-15 08:44:15', '', 0, 'http://localhost/?p=1', 0, 'post', '', 3),
(2, 1, '2012-08-16 03:52:24', '2012-08-16 03:52:24', '<strong>Welcome to the RC Plane Database!</strong>\r\n\r\nI originally created this database as a way to include what planes pilots were flying in a contest setting for the timing applications that I am writing, but I quickly realized that there are so many possibilities in so many contests that I couldn''t enter them all myself.\r\n\r\nI looked around, and I saw some posts on RC groups about similar projects throughout the years, but it appears that none of them are alive anymore.\r\n\r\nSince programming web content is kind of what I do, I decided to start working on putting together a database for all the planes we fly, and it kept getting more and more complicated. The only way I would be able to get it to be somewhat accurate is to open it up to the good people of the RC community to fill in all the blanks.\r\n\r\nSo, go look at what''s hanging in your garage, old or new, and immortalize its characteristics in our database for all to see, complete with all the specs, pics and information that you can give to make this database complete.\r\n\r\nHappy Flying!\r\n\r\nTim\r\n\r\n&nbsp;<p style="text-align: center;"><input class="block-button" onclick="browse.submit();" type="button" value=" Browse Planes " /></p>\r\n\r\n<form method="POST" action="/f3x/" name="browse"><input type="hidden" name="action" value="plane" />\r\n</form>', 'RC Plane Database', '', 'publish', 'open', 'open', '', 'sample-page', '', '', '2012-11-01 21:50:24', '2012-11-02 04:50:24', '', 0, 'http://localhost/?page_id=2', 10, 'page', '', 0),
(63, 1, '2012-09-09 19:35:17', '2012-09-10 02:35:17', 'Welcome to the Event area. This is where it gets cool. You can create events and use the system to easily fill in all of the blanks and do all of the scoring for you.\n\nYou are also able to see other events and their scores from around the world.\n\nI hope to eventually have all of the disciplines scoring functionalities here for easy plug an play usage.\n\nA long term goal is to have this hooked up to an actual timing system that can run a scoreboard, help organize the event, and show results in real time for anyone looking on the net.\n\nBut I get ahead of myself. The first up', 'RC Events', '', 'inherit', 'open', 'open', '', '7-autosave', '', '', '2012-09-09 19:35:17', '2012-09-10 02:35:17', '', 7, 'http://localhost/?p=63', 0, 'revision', '', 0),
(4, 1, '2012-08-16 00:32:27', '2012-08-16 07:32:27', '', 'GatorF3B2012Vampire', '', 'inherit', 'open', 'open', '', 'gatorf3b2012vampire', '', '', '2012-08-16 00:32:27', '2012-08-16 07:32:27', '', 0, 'http://localhost/wp-content/uploads/2012/08/GatorF3B2012Vampire.jpg', 0, 'attachment', 'image/jpeg', 0),
(6, 1, '2012-08-16 03:52:24', '2012-08-16 03:52:24', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickies to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://localhost/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'inherit', 'open', 'open', '', '2-revision', '', '', '2012-08-16 03:52:24', '2012-08-16 03:52:24', '', 2, 'http://localhost/?p=6', 0, 'revision', '', 0),
(7, 1, '2012-08-16 00:59:13', '2012-08-16 07:59:13', '<span style="color: #0000ff;"><strong>Welcome to the Event area</strong></span>.\r\n\r\nThis is where it gets cool. You can create events and use the system to easily fill in all of the blanks and do all of the scoring for you.\r\n\r\nYou are also able to see other events and their scores from around the world.\r\n\r\nI hope to eventually have all of the disciplines scoring functionalities here for easy plug an play usage.\r\n\r\nA long term goal is to have this hooked up to an actual timing system that can run a scoreboard, help organize the event, and show results in real time for anyone looking on the net.\r\n\r\nBut I get ahead of myself. The first scoring system will be an F3F event, because it is probably the easiest.\r\n\r\nI hope you all enjoy!\r\n\r\n&nbsp;\r\n<p style="text-align: center;"><input class="block-button" onclick="browse.submit();" type="button" value=" Browse Events " /></p>\r\n\r\n<form action="/f3x/" method="POST" name="browse"><input type="hidden" name="action" value="event" /></form>', 'RC Events', '', 'publish', 'open', 'open', '', 'rc-events', '', '', '2013-02-15 00:48:41', '2013-02-15 08:48:41', '', 0, 'http://localhost/?page_id=7', 30, 'page', '', 0),
(8, 1, '2012-08-16 00:59:06', '2012-08-16 07:59:06', '', 'RC Events', '', 'inherit', 'open', 'open', '', '7-revision', '', '', '2012-08-16 00:59:06', '2012-08-16 07:59:06', '', 7, 'http://localhost/?p=8', 0, 'revision', '', 0),
(69, 1, '2012-11-01 21:48:02', '2012-11-02 04:48:02', 'Welcome to the RC Locations Area!\r\n\r\nThis section also came about from my timing dreams as a way to pinpoint the many locations that we fly.\r\n\r\nOnce again, I have created a nice database that we can all use to fill in the locations to our favorite flying spots, the complicated directions on how to get there, amenities, what we can fly there, permissions, any site pictures, special notes, comments, reviews, etc...\r\n\r\nI hope you find it useful and can use it to share your favorite sites with us all.\r\n<p style="text-align: center;"><input class="block-button" onclick="browse.submit();" type="button" value=" Browse RC Locations " /></p>\r\n\r\n<form method="POST" name="browse"><input type="hidden" name="action" value="location" />\r\n<input type="hidden" name="function" value="location_view" /></form>', 'RC Locations', '', 'inherit', 'open', 'open', '', '17-revision-6', '', '', '2012-11-01 21:48:02', '2012-11-02 04:48:02', '', 17, 'http://localhost/?p=69', 0, 'revision', '', 0),
