(52, 1, '2012-08-17 01:42:06', '2012-08-17 08:42:06', '<strong>Welcome to the RC Plane Database!</strong>\r\n\r\nI originally created this database as a way to include what planes pilots were flying in a contest setting for the timing applications that I am writing, but I quickly realized that there are so many possibilities in so many contests that I couldn''t enter them all myself.\r\n\r\nI looked around, and I saw some posts on RC groups about similar projects throughout the years, but it appears that none of them are alive anymore.\r\n\r\nSince programming web content is kind of what I do, I decided to start working on putting together a database for all the planes we fly, and it kept getting more and more complicated. The only way I would be able to get it to be somewhat accurate is to open it up to the good people of the RC community to fill in all the blanks.\r\n\r\nSo, go look at what''s hanging in your garage, old or new, and immortalize its characteristics in our database for all to see, complete with all the specs, pics and information that you can give to make this database complete.\r\n\r\nHappy Flying!\r\n\r\nTim\r\n\r\n&nbsp;', 'RC Plane Database', '', 'inherit', 'open', 'open', '', '2-revision-6', '', '', '2012-08-17 01:42:06', '2012-08-17 08:42:06', '', 2, 'http://localhost/?p=52', 0, 'revision', '', 0),
