(81, 1, '2013-02-15 00:41:25', '2013-02-15 08:41:25', 'Welcome all Pilots and RC Flying enthusiasts!\r\n\r\nI have created this site out of the desire to have a single location where we can have information about flying sites, the planes we fly, and a place for competition information. I hope you will sign up as a user and contribute to the databases however you can, making this a location that everyone can go to when wondering about where they can fly when they are traveling, or if they need crucial data about some different planes.\r\n\r\nPlease let me know what you think, and help me to make this site really belong to our great RC community!\r\n\r\nTim\r\n', 'Welcome To The Vault', '', 'inherit', 'open', 'open', '', '1-revision-3', '', '', '2013-02-15 00:41:25', '2013-02-15 08:41:25', '', 1, 'http://rcvault.com/?p=81', 0, 'revision', '', 0),
