(88, 1, '2012-11-04 08:50:24', '2012-11-04 16:50:24', 'Welcome to the Event area. This is where it gets cool. You can create events and use the system to easily fill in all of the blanks and do all of the scoring for you.\r\n\r\nYou are also able to see other events and their scores from around the world.\r\n\r\nI hope to eventually have all of the disciplines scoring functionalities here for easy plug an play usage.\r\n\r\nA long term goal is to have this hooked up to an actual timing system that can run a scoreboard, help organize the event, and show results in real time for anyone looking on the net.\r\n\r\nBut I get ahead of myself. The first scoring system will be an F3F event, because it is probably the easiest.\r\n\r\nI hope you all enjoy!\r\n\r\n&nbsp;<p style="text-align: center;"><input class="block-button" onclick="browse.submit();" type="button" value=" Browse Events " /></p>\r\n\r\n<form method="POST" action="/f3x/" name="browse"><input type="hidden" name="action" value="event" />\r\n</form>', 'RC Events', '', 'inherit', 'open', 'open', '', '7-revision-10', '', '', '2012-11-04 08:50:24', '2012-11-04 16:50:24', '', 7, 'http://rcvault.com/?p=88', 0, 'revision', '', 0),
(89, 1, '2013-02-15 00:47:59', '2013-02-15 08:47:59', '<span style="color: #0000ff;"><strong>Welcome to the Event area</strong></span>.\r\n\r\nThis is where it gets cool. You can create events and use the system to easily fill in all of the blanks and do all of the scoring for you.\r\n\r\nYou are also able to see other events and their scores from around the world.\r\n\r\nI hope to eventually have all of the disciplines scoring functionalities here for easy plug an play usage.\r\n\r\nA long term goal is to have this hooked up to an actual timing system that can run a scoreboard, help organize the event, and show results in real time for anyone looking on the net.\r\n\r\nBut I get ahead of myself. The first scoring system will be an F3F event, because it is probably the easiest.\r\n\r\nI hope you all enjoy!\r\n\r\n&nbsp;\r\n<p style="text-align: center;"><input class="block-button" onclick="browse.submit();" type="button" value=" Browse Events " /></p>\r\n\r\n<form action="/f3x/" method="POST" name="browse"><input type="hidden" name="action" value="event" /></form>', 'RC Events', '', 'inherit', 'open', 'open', '', '7-revision-11', '', '', '2013-02-15 00:47:59', '2013-02-15 08:47:59', '', 7, 'http://rcvault.com/?p=89', 0, 'revision', '', 0),
